ссе. \n\n● Билет можно купить заранее на определённую дату: максимум за 10 дней до поездки. \n\n● Билет даёт право на одну поездку и действует до 3 часов ночи следующего после даты поездки дня.\n\n🚇 Как купить билет в приложении Туту? \n\n● Установите бесплатное приложение «Расписание электричек Туту.ру». \niOS: https://www.tutu.ru/s/bAr4U/\nAndroid: https://www.tutu.ru/s/dCt6Y/\n\n● Выберите нужные пункты отправления и прибытия, чтобы узнать расписание поездов по этому маршруту. \n\n● В расписании нажмите на кнопку «Купить», которая находится рядом с каждым временем отправления. Билет даёт право на одну поездку и действует до 3 часов ночи следующего после даты поездки дня. \n\n● При первой покупке билета в приложении заполните данные пассажира (включая паспортные). Эта информация сохранится, и в следующий раз заполнять ничего не нужно. \n\n● Оплатите билет с помощью Apple/Google Pay или банковской картой. После оплаты билет появится в приложении во вкладке «Мои билеты», но перед поездкой его нужно активировать. Как выглядит активация — ищите на скриншоте ниже. \n\nУже пробовали купить так билет на электричку? Или пока только в автомате или традиционно в кассах? :)\n\nФото: Алексей Уланов")]), canDelete: Optional(1), comments: VKClient.WallComments(canPost: 1, canView: 1, count: 0), hash: Optional("bSjitkribAysG6ZOddRepAFl"), type: "post", attachments: Optional([]), date: 1605731536, fromId: Optional(220458), id: 3527, isArchived: false, likes: VKClient.WallLikes(count: 6, userLikes: 0, repostDisabled: false), ownerId: 220458, reposts: VKClient.WallReposts(count: 0, userReposted: 0), text: "Ура! Мы сделали это!", views: Optional(VKClient.WallViews(count: 126))), VKClient.Wallpost(copyHistory: nil, canDelete: Optional(1), comments: VKClient.WallComments(canPost: 1, canView: 1, count: 0), hash: Optional("aA37Bv8onn4e1EcRkC7hAvrM"), type: "post", attachments: Optional([VKClient.CommentsAttachment(type: "photo", photo: Optional(VKClient.PhotoAttachment(id: 457239624, ow